import "./TodoList.css";

const Todo = (props) => {
    return (
        <ul className="todo">
            { props.todoList.map((todo, index) => {
                return (
                    <div className="item">
                        <li key={ index }> { todo } </li>
                        <input type="checkbox" />
                    </div>
                )
            }) }
        </ul>
    );
}

export default Todo;
